  return (
    <TouchableOpacity
        style={styles.gridList}
        onPress={() => {
          props.navigation.navigate({routeName: 'CategoriesMeal', params: {
            categoryId: itemData.item.id}
          });
        }}
      >
        <View>
          <Text>{itemData.item.title}</Text>
        </View>
      </TouchableOpacity>
  );
};

const styles =  StyleSheet.create({
  gridList: {
    flex: 1,
    margin: 15,
    height: 150
  }
});

